import { useEffect, useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import jobService from '../services/job.service';
const API_URL="http://localhost:7777/job/seealljobs";
const Dashboard = () => {

  const [job, setJobs] = useState([]);
  const [search,setSearch]=useState("")

  const init = () => {
    jobService.getAll()
      .then(response => {
        console.log('Printing job data', response.data);
        setJobs(response.data);
      })
      .catch(error => {
        console.log('Something went wrong', error);
      }) 
  }

  useEffect(()=> {
    init();
  }, []);

  const handleDelete = (id) => {
    console.log('Printing id', id);
    if(window.confirm('are you sure'))
    jobService.remove(id)
      .then(response => {
        console.log('job deleted successfully', response.data);
        init();
      })
      .catch(error => {
        console.log('Something went wrong', error);
      })
  }

  return (
    <div className="container">
      <h3>List of jobs</h3>
      <form >
            <input width="100px" type="text" placeholder="Search based on Years of experience" value={search} onChange={(e)=>
                    setSearch(e.target.value)}/><br/><br/>  
                    <button className='btn btn-primary'>Apply</button> 
                </form> 
                <div className='container'>
                   <div className='row'>

                   {job.filter((job)=>
                       job.yrsofexp).map((item)=>(
                           <div className='col-md-4'>
                               <div className='card'>

                               <div className='card-body'>
                                   <h5 className='card-title'>{item.getCompanyname}</h5>
                                   <h5 className='card-title'>{item.getDesignation}</h5>
                                   <h5 className='card-title'>{item.getYrsofexp}</h5>
                                   <h5 className='card-title'>{item.getJobdesc}</h5>
                                   <h5 className='card-title'>{item.getLocation}</h5>


                       </div>

                       </div>
                       </div>

                       )

                       )}
                       </div></div>

      <hr/>
      <div>

        <Link to="/add" className="btn btn-primary mb-2">Add Job</Link>
        <table className="table table-bordered table-striped">
          <thead className="thead-dark">
            <tr>
              <th>Logo</th>
              <th>Company Name</th>
              <th>Desgination</th>
              <th>Yrs of Exp</th>
              <th>Job description</th>
              <th>Location</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
          {
            job.map(job => (
              <tr key={job.id}>
                <td align="center"><img src={job.logo} width="50" height="45" alt="Company logo"/></td>
                <td>{job.companyname}</td>
                <td>{job.designation}</td>
                <td>{job.yrsofexp}</td>
                <td>{job.jobdesc}</td>
                <td>{job.location}</td>
                <td>
                  <button className="btn btn-success" >Apply</button>
                  <br/><br/>
                  <Link className="btn btn-info" to={`/job/edit/${job.id}`}>Update</Link>
                  <br/><br/>
                  <button className="btn btn-danger ml-2" onClick={() => {
                    handleDelete(job.id);
                  }}>Delete</button>
                </td>
              </tr>
            ))
          }
          </tbody>
        </table>

      </div>
    </div>
  );
}

export default Dashboard
